import React from "react";

const Home = () => {
  return (
    <div className="container text-center my-5">
      <h1 className="display-4">Welcome to RecipeShare</h1>
      <p className="lead">Discover, Share, and Manage Amazing Recipes!</p>
      <img 
        src="https://wallpapers.com/images/hd/food-4k-spdnpz7bhmx4kv2r.jpg" 
        alt="Food" 
        className="img-fluid rounded shadow-sm"
      />
      <div className="mt-4">
        <a href="/register" className="btn btn-primary btn-lg mx-2">Get Started</a>
        <a href="/login" className="btn btn-outline-secondary btn-lg mx-2">Login</a>
      </div>
    </div>
  );
};

export default Home;
